import React, { Component } from 'react';
import { Button, Box, AppBar, Toolbar, IconButton, Container, Typography } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import {makeStyles} from '@material-ui/core/styles';
import SignInButton from '../Buttons/SignInButton';
import SignUpButton from '../Buttons/SignUpButton';

const useStyles = makeStyles((theme: any) =>({
    root: {
        flexGrow: 1
    },
    menuButton: {
        marginRight:theme.spacing(1)
    },
    title: {
        flexGrow: 1
    }
}));

interface IAppbarGenericProps
{
    leftMenu?: React.Chil,
    rightButtons?: React.ReactNode
}


const AppbarGeneric: React.FC<IAppbarGenericProps> = ({leftMenu = null, rightButtons = null}) => {
    const styles = useStyles();

    return(
        <AppBar color="primary" position="fixed">
                <Container fixed>
                    <Toolbar>
                        <Box>
                            <IconButton edge="start" color="inherit" aria-label="menu" className={styles.menuButton}>
                                if(leftMenu != null)
                                {
                                    {leftMenu}
                                }
                                <MenuIcon />
                            </IconButton>
                        </Box>
                        <Typography variant="h6" className={styles.title}>Expense Tracker</Typography>
                         <SignInButton />
                         <SignUpButton />
                     </Toolbar>
                 </Container>
             </AppBar>
    );
}

export default AppbarGeneric;
